import {Fragment, useState} from 'react';
import Header from './components/Layout/Header';
import Meals from './components/Meals/Meals';
import Cart from './components/Cart/Cart';
import CartProvider from './store/CartProvider';
import Button from './components/Layout/Button';

function App() {

  const pageOneMeals = [
    {
      id: 'm1',
      name: 'Spicy Salmon Sushi',
      description: 'Finest fish and veggies',
      price: 22.99,
    },

    {
      id: 'm2',
      name: 'Schnitzel',
      description: 'A german specialty!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Barbecue Burger',
      description: 'American, raw, meaty',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
    {
      id: 'm5',
      name: 'Spicy YellowTail Sushi',
      description: 'Finely sliced, fresh yellowtail fish',
      price: 22.99,
    },


  ];


  const pageTwoMeals = [
    {
      id: 'm1',
      name: 'Spicy ',
      description: 'Finest fish and veggies',
      price: 22.99,
    },

    {
      id: 'm2',
      name: 'Schnitzel',
      description: 'A german specialty!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Barbecue Burger',
      description: 'American, raw, meaty',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
    {
      id: 'm5',
      name: 'Spicy YellowTail Sushi',
      description: 'Finely sliced, fresh yellowtail fish',
      price: 22.99,
    },


  ];
  const [cartIsShown, setCartIsShown] = useState(false);
  const [pageOnFirst, setChangePage] = useState(true);

  const showCartHandler = () => {
    setCartIsShown(true);
  };

  const hideCartHandler = () => {
    setCartIsShown(false);
  };

  const forwardPage = () => {
    setChangePage(false);
  }

  const backPage = () => {
    setChangePage(true);
  }

  return (
     <CartProvider>
     {cartIsShown && <Cart onClose={hideCartHandler}/>}
      <Header onCartClick={showCartHandler}/>
      <main>
       <Meals/>
       {pageOnFirst && <Button changePage={forwardPage}>Next Page</Button>}
       {!pageOnFirst && <Button changePage={backPage}>Previous Page</Button>}
      </main>


      </CartProvider>
  );
}

export default App;
